// src/main.js

import { createApp } from 'vue';
import App from './App.vue';
import axios from './plugins/axios';

const app = createApp(App);

app.config.productionTip = false; // Set productionTip in the app's config

app.mixin({
    // Set up Axios plugin after creating the app
    created() {
        this.$axios = axios;
    },
});

app.mount('#app');
